def draw_graph(l, s):
    """
    :param l: A list including [schedule matrix, index] and the size of this square matrix
    :param s: schedule list
    :param size: size of graph matrix
    :return: matrix denoting schedule graph
    """
    graph_m = zeros(32)
    for u in range(32):
        for v in range(32):
            c = Matrix([[0, 0], [0, 0], [0, 0], [0, 0]])
            c[:, 0] = l[u][0][:, 1]
            c[:, 1] = l[v][0][:, 0]
            if c in s:
                graph_m[u, v] = 1
            del c
    gc.collect()
    return graph_m


def graph_2_dict(graph):
    #  change denoting a graph from matrix to dict
    g = {}
    size = graph.rows
    for p in range(size):
        temp = []
        for q in range(size):
            if graph[p, q] == 1:
                temp.append(q)
        g[p] = temp
        del temp
    del size
    gc.collect()
    return g


def dfs(graph, start, end):
    fringe = [(start, [])]
    while fringe:
        state, path = fringe.pop()
        if path and state == end:
            yield path
            continue
        for next_state in graph[state]:
            if next_state in path:
                continue
            fringe.append((next_state, path+[next_state]))
        del state
        del path
    gc.collect()

